message:
URGENTE 🚨 
TODOS NAS PORTAS DOS QUARTÉIS CHEGOU A HORA 🇧🇷
@GeFazioBreakingNews🇺🇸🇧🇷

"Que situação bizarra, alucinante e demencial que todos nós vivemos neste momento: os fraudadores sabem que fraudaram; 
o fraudado sabe que foi fraudado; 
todas as lideranças das instituições - do Senado à Câmara, das Forças Armadas à Polícia Federal - sabem que houve fraude.

 No entanto, todos os líderes: FINGEM não saber; 
FINGEM não ter certeza; FINGEM que há apenas indícios; 
FINGEM que ainda falta provar o que já está exaustivamente provado; 
FINGEM que estão fazendo alguma coisa; 
FINGEM que não há o que fazer; 
FINGEM que são decentes e honrados; 
FINGEM que estão defendendo a democracia; 
FINGEM que não estão vendo o povo honesto nas ruas; FINGEM que não estão sacrificando um presidente honesto e honrado no altar das conveniências; 
FINGEM que não estão vendo um bandido se preparando para assumir a presidência e destruir o Brasil em tempo recorde; 
FINGEM que vivem em Marte e não no Brasil." 
(Alexandre Garcia)
